import React from 'react'
import { useRef,useEffect,useState} from 'react';
import '../Styles/style_home.css'
import '../Components/HideNav'

function Home() {
  const videoRef = useRef(null);
  useEffect(() => {
    videoRef.current.play();
  }, []);

  const [selectedOptioncase1, setSelectedOptioncase1] = useState('');
  const handleSelectChangecase1 = (event) => {
    setSelectedOptioncase1(event.target.value);
  };
  const [selectedOptioncase2, setSelectedOptioncase2] = useState('');
  const handleSelectChangecase2 = (event) => {
    setSelectedOptioncase2(event.target.value);
  };
  const [selectedOptioncase3, setSelectedOptioncase3] = useState('');
  const handleSelectChangecase3 = (event) => {
    setSelectedOptioncase3(event.target.value);
  };


  return (
    <div className="homepage">
      <div className="box1">
        <video ref={videoRef} className="video" autoPlay muted loop>
          <source src="your-video.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>
        <b>
          <p>Agricity's agricultural drones are equipped with cutting-edge sensors and imaging technology,<br /> offering farmers comprehensive aerial insights for crop monitoring and management. Our drones enable precise <br /> spraying, mapping, and analysis, empowering farmers to make data-driven decisions and optimize yields.<br /> With user-friendly interfaces and robust performance, Agricity drones streamline farming operations,<br /> reduce input costs, and promote sustainable practices, ensuring a prosperous future for agriculture.<br /></p>
        </b>
      </div>
      <div className="box2">
      <div id="expertsol">
        <select value1={selectedOptioncase1} onChange={handleSelectChangecase1}>
          <option value1="option1">Option 1</option>
          <option value1="option2">Option 2</option>
          <option value1="option3">Option 3</option>
        </select>
        <div>
          Selected Option Value: {selectedOptioncase1}
        </div>
      <select value2={selectedOptioncase2} onChange={handleSelectChangecase2}>
        <option value2="option1">Option 1</option>
        <option value2="option2">Option 2</option>
        <option value2="option3">Option 3</option>
      </select>
      <div>
        Selected Option Value: {selectedOptioncase2}
      </div>

      <select value3={selectedOptioncase3} onChange={handleSelectChangecase3}>
        <option value3="option1">Option 1</option>
        <option value3="option2">Option 2</option>
        <option value3="option3">Option 3</option>
      </select>
      <div>
        Selected Option Value: {selectedOptioncase3}
      </div>
    </div>
    </div>
    </div>
  )
}

export default Home
